Nightmares on Wax -- "Les Nuits" -- Track 1. From the 1999 Warp Records/Matador Records Studio LP "Carboot Soul." {*Contains an Interpolation from "Summer in The City" [Long Version] from the 1973 Quincy Jones A&M/Verve Music Group-Universal Music Group Recordings, Inc. Album "You've Got It Bad, Girl."}

Featuring: George Evelyn -- Composer; Pure Strings Orchestra -- Strings; Sara Winton -- Vocals; EASE -- Mixing, Producer; Robin Taylor-Firth -- Keyboards, Composer; Bruce Wood -- Engineer and Glyn Poole -- Producer.
